import React from 'react';
import { Card, Icon, Image, Container, Header, Grid, Button } from 'semantic-ui-react';

// props: name, handleClose (from menupage)
class OrderPopUp extends React.Component {

  render() {

    return (
      <Card>
        <Card.Content>
          <Button circular size='tiny' icon='heart' floated='right' color='grey' inverted />
          <Card.Header>{this.props.name}</Card.Header>
          <Card.Meta>
            {/* description */}
          </Card.Meta>
        </Card.Content>
        <Card.Content extra>
          <a>
            <Icon name='user' />
            22 Friends
          </a>
        </Card.Content>
      </Card>
    );
  }
}

export default OrderPopUp;
